import React, { useState, useEffect } from 'react';
import { StyleSheet, Text, View, TouchableOpacity, Pressable, Alert, Vibration } from 'react-native';

export default function CountDown({ navigation }) {
  const [hours, setHours] = useState(0);
  const [minutes, setMinutes] = useState(0);
  const [seconds, setSeconds] = useState(0);
  const [counting, setCounting] = useState(false);

  const chomePage = () => {
    navigation.navigate('Home');
  };

  useEffect(() => {
    let totalSeconds = hours * 3600 + minutes * 60 + seconds;
    let interval;

    if (counting && totalSeconds > 0) {
      interval = setInterval(() => {
        totalSeconds -= 1;
        const h = Math.floor(totalSeconds / 3600);
        const m = Math.floor((totalSeconds % 3600) / 60);
        const s = totalSeconds % 60;

        setHours(h);
        setMinutes(m);
        setSeconds(s);

        if (totalSeconds === 0) {
          setCounting(false);
          clearInterval(interval);
          Vibration.vibrate([1000, 600]);
          Alert.alert("Süre Bitti!", 'Countdown Süresi Tamamlandı.', [{ 
            text: 'Tamam'
          }]);
        }
      }, 1000);
    }

    return () => {
      clearInterval(interval);
    };
  }, [hours, minutes, seconds, counting]);

  const startCountdown = () => {
    const totalSeconds = hours * 3600 + minutes * 60 + seconds;
    if (totalSeconds > 0) {
      setCounting(true);
    }
  };

  const stopCountdown = () => {
    setCounting(false);
  };

  const increment = (field) => {
    if (!counting) {
      switch (field) {
        case 'hours':
          setHours(hours + 1);
          break;
        case 'minutes':
          setMinutes(minutes + 1);
          break;
        case 'seconds':
          setSeconds(seconds + 1);
          break;
        default:
          break;
      }
    }
  };

  const decrement = (field) => {
    if (!counting) {
      switch (field) {
        case 'hours':
          setHours(Math.max(0, hours - 1));
          break;
        case 'minutes':
          setMinutes(Math.max(0, minutes - 1));
          break;
        case 'seconds':
          setSeconds(Math.max(0, seconds - 1));
          break;
        default:
          break;
      }
    }
  };

  return (
    <>
      <View style={styles.container}>
        <View style={styles.timerContainer}>
          <TouchableOpacity onPress={() => increment('hours')}>
            <Text style={styles.buttonHoursText}>+</Text>
          </TouchableOpacity>

          <Text style={styles.timerhoursText}>{`${hours.toString().padStart(2, '0')}`}</Text>

          <TouchableOpacity onPress={() => decrement('hours')}>
            <Text style={styles.buttonHoursText}>-</Text>
          </TouchableOpacity>
        </View>

        <Text style={styles.colon}>:</Text>

        <View style={styles.timerContainer}>
          <TouchableOpacity onPress={() => increment('minutes')}>
            <Text style={styles.buttonMinuteText}>+</Text>
          </TouchableOpacity>

          <Text style={styles.timerminuteText}>{`${minutes.toString().padStart(2, '0')}`}</Text>

          <TouchableOpacity onPress={() => decrement('minutes')}>
            <Text style={styles.buttonMinuteText}>-</Text>
          </TouchableOpacity>
        </View>

        <Text style={styles.colon}>:</Text>

        <View style={styles.timerContainer}>
          <TouchableOpacity onPress={() => increment('seconds')}>
            <Text style={styles.buttonSecondText}>+</Text>
          </TouchableOpacity>

          <Text style={styles.timersecondText}>{`${seconds.toString().padStart(2, '0')}`}</Text>

          <TouchableOpacity onPress={() => decrement('seconds')}>
            <Text style={styles.buttonSecondText}>-</Text>
          </TouchableOpacity>
        </View>
      </View>

      <View style={{ flex: 1, backgroundColor: '#000', flexWrap: 'wrap', alignContent:'space-around' }}>
        <Pressable style={styles.homescreenButton} onPress={chomePage}>
          <Text style={styles.homescreenText}>Saat'e Dön</Text>
        </Pressable>

        {!counting ? (
          <TouchableOpacity style={styles.startstopButton} onPress={startCountdown}>
            <Text style={styles.startstopButtonText}>Başlat</Text>
          </TouchableOpacity>
        ) : (
          <TouchableOpacity style={styles.startstopButton} onPress={stopCountdown}>
            <Text style={styles.startstopButtonText}>Durdur</Text>
          </TouchableOpacity>
        )}
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 4,
    backgroundColor: '#000',
    flexDirection:'row',
    alignItems: 'center',
    justifyContent: 'center',
  },
  timerContainer: {
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    opacity: 0.4,
  },
  buttonHoursText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#b1b2ff',
    fontSize: 50,
  },
  buttonMinuteText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ffb3b3',
    fontSize: 50,
  },
  buttonSecondText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ECA869',
    fontSize: 50,
  },
  timerhoursText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#b1b2ff',
    fontSize: 145,
  },
  timerminuteText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ffb3b3',
    fontSize: 145,
  },
  timersecondText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ECA869',
    fontSize: 145,
  },
  colon: {
    fontFamily: 'ConcertOne-Regular',
    color: '#eef1ff',
    fontSize: 145,
    opacity: 0.4,
    marginBottom: 25,
  },
  startstopButton: {
    width: 150,
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    paddingVertical: 12,
    paddingHorizontal: 16,
    borderRadius: 4,
    elevation: 3,
    backgroundColor: '#ECA869',
    opacity: 0.4,
  },
  startstopButtonText: {
    fontSize: 16,
    lineHeight: 21,
    fontWeight: 'bold',
    letterSpacing: 0.25,
    color: 'white',
  },

  homescreenButton: {
    width: 150,
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    paddingVertical: 12,
    paddingHorizontal: 16,
    borderRadius: 4,
    elevation: 3,
    backgroundColor: '#b1b2ff',
    opacity: 0.4,
  },
  homescreenText: {
    fontSize: 16,
    lineHeight: 21,
    fontWeight: 'bold',
    letterSpacing: 0.25,
    color: 'white',
  },
});
